export const LoginSuccess = (user) => ({type: "LOGIN_SUCCESS", payload: user})

export const LoginFailure = (user) => ({type: "LOGIN_FAILURE"})

export const LogOut = (user) => ({type: "LOGOUT"})

export const UpdateStart = (userCredentials) => ({type: "UPDATE_START"})
export const UpdateSuccess = (user) => (
    {type: "UPDATE_SUCCESS", payload: user}
)

export const UpdateFailure = () => ({type: "UPDATE_FAILURE"})
